import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  onGetStockPrice() {
    const getStockPrice = () => {
      let url = () => {
        var ticker = document.getElementById('ticker-input');
        if (ticker)
          return "http://localhost:8000/" + ticker;
        return "http://localhost:8000/"
      };
      fetch(url, {
        method: 'GET',
        headers: {
          Accept: 'application/json'
        }
      })
        .then(response => console.log(response))
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <a
            href = "http://localhost:8000?variable=(?)"
            target="_blank"
            > Get Today's Stock Price</a>
            <form onSubmit className="search-form">
              <input
                id = "ticker-input"
                type="text"
                placeholder="Enter search ticker..."
              />
              <div>
                <button onClick={this.onGetStockPrice}>Today's Stock Price</button>;
              </div>
            </form>
        </header>
      </div>
    );
  }

}

export default App;
